import './styles/global-style.css';
import { BrowserRouter } from 'react-router-dom';
import styled from 'styled-components';
import Router from './routes/Router';

import { CiDark } from "react-icons/ci";

function App() {

  return (
    <BrowserRouter>
    <Header>
            <HeaderList>
              <LoginButton>로그인</LoginButton>
              <li>간단 설명서</li>
              <li>Twiroller에 대하여</li>
            </HeaderList>
            <ThemeBtn><CiDark /></ThemeBtn>
          </Header>
      <Router/>
    </BrowserRouter>
  )
}
export default App;



const LoginButton = styled.button`
background-color: aliceblue;
color: #888;
cursor: pointer;
border-radius: 20px;
width: 120px;
height: 40px;
position: absolute;
left: 1rem;
top: 0.5rem;
`

const ThemeBtn = styled.button`
width: 50px;
height: 50px;
border-radius: 50%;
border: 1px solid #fff;
margin-top: 5px;;
position: absolute;
right: 10px;
color: #1D9BF0;;
cursor: pointer;
font-size: 35px;
background-color: #fff;
&:hover{
  background-color: #eeeeee;
}
`

const Header = styled.header`
width: 100%;
background-color: #1D9BF0;
height: 60px;
text-align: center;
display: flex;
justify-content: center;
color: #e4f2ff;
position: absolute;
`
const HeaderList = styled.ul`
display: flex;
justify-content: space-between;
width: 50%;
height: 60px;    
li {
  font-weight: 600;
  font-size: 23px;
  cursor: pointer;
  height: 100%;
  display: flex;
  align-items: center;
  &:hover {
  color: #ffffff;
}
}
`
